import React, { Component } from "react";

export default class GameModel extends Component {
  render() {
    return (
      <div>
        <div class="header-model">
          <span> Congratulations</span>
        </div>
        <div>
          <img src="./imgs/winner" alt="Winner Image" />
        </div>
      </div>
    );
  }
}
